import { Box, useTheme } from '@mui/material';
import { tokens } from '../themes/themes';


import '../nav/nav.scss';

export default function Nav() {
  const theme = useTheme();
  const colors = tokens (theme.palette.mode);
  
  return (
    <Box 
      display = {"flex"}
      alignItems = {"center"}
      sx= {{
          height: 50,
          width: "99hv",
          backgroundColor: colors.primary[900]
      }}>

      <Box
        fontSize = {"20px"}
        marginLeft = {"15px"}
        >{`</> elBernameg`}
      </Box>

    </Box>
  )
}
